  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Cape May
  National Wildlife Refuge outlines Refuge accomplishments during the 1991 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is also discussed. The report includes a planning section which
  discusses management plans, public participation, and research and investigations.
  Refuge administration is outlined; information about personnel, volunteer programs,
  funding, safety, and technical assistance is given. Habitat management is also covered;
  subjects include wetlands and forests. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, shorebirds, raptors, other migratory birds, game mammals, marine mammals,
  and animal control. The public uses of the Refuge described in this report include
  outdoor classrooms, interpretive programs, and hunting. The equipment and facilities
  section of the report provides information about equipment utilization and replacement,
  communications systems, and computer systems. Cooperative programs and items of
  interest are provided at the end. Photographs are attached.\",\n\t\"owner_org\":
